import React, { Component } from 'react';
import { Link } from 'react-router-dom';

import '../../styles/css/home/Home.css';
import gif1 from '../../styles/assets/guile.gif';
import gif2 from '../../styles/assets/ken.gif';

class Home extends Component {
  render() {
    return (
      <div className="Home">
        <div className="title">
          <p className="name left">Wild</p>
          <p className="name right">Fighter</p>
        </div>
        <div className="Home_animation">
          <img className="Home_gif1" src={gif1} alt="guile" />
          <div className="Home_button" onClick="">
            <Link>
              <input className="Home_play" type="button" value="PLAY" />
            </Link>
          </div>
          <img className="Home_gif2" src={gif2} alt="ken" />
        </div>
      </div>
    );
  }
}

export default Home;
